definition.postcondition:
- the package is not at the location any more.
- the package is in the truck;
- the the truck fuel burn per minute is increased;
- the truck load is increased.

definition.invariants:
- the truck remains at the same location;
- if the truck is empty, it remains empty;
- if there is a driver driving the truck, he remains there.

definition.precondition:
- the truck must be at the location;
- the package must be in the truck;
- there must be a driver driving the truck, i. e., it must not be empty.

definition.postcondition:
- the package is not it the truck any more;
- the package is at the location;
- the the truck fuel burn per minute is decreased;
- the truck load is decreased.

definition.invariants:
- the truck remains at the same location;
- if the truck is empty, it remains empty;
- if there is a driver driving the truck, he remains there.

definition.precondition:
- the truck must be at the origin location;
- the driver must be driving the truck;
- there must be a link between the origin and the destination location.

definition.postcondition:
- the truck is at the destination location;
- the fuel used is increased, accordingly to the truck fuel burn per minute and the time to drive between the two locations;
- the driven time is increased accordingly to the time to drive between the two locations.

- the driver is not driving the truck any more;
- the driver is at the location;
- the truck is empty.
